package backWeb.saram_vo;

public class SaramSelect {
   private String iloc;
   private String ijob;
   public SaramSelect() {
      // TODO Auto-generated constructor stub
   }
   public SaramSelect(String iloc, String ijob) {
      this.iloc = iloc;
      this.ijob = ijob;
   }
   public String getIloc() {
      return iloc;
   }
   public void setIloc(String iloc) {
      this.iloc = iloc;
   }
   public String getIjob() {
      return ijob;
   }
   public void setIjob(String ijob) {
      this.ijob = ijob;
   }
   
}